        "talents": [
            {
                "name": "Sword of the Radiant Path",
                "type": "Normal Attack",
                "icon": "assets/character/talents/Ceremonial Bladework.png",
                "description": "Normal AttackPerforms up to 3 rapid strikes.Charged AttackConsumes a certain amount of Stamina to unleash 2 rapid sword strikes.Plunging AttackPlunges from mid-air to strike the ground below, damaging opponents along the path and dealing AoE DMG upon impact."
            },
            {
                "name": "Nights of Formal Focus",
                "type": "Elemental Skill",
                "icon": "assets/character/talents/Nights of Formal Focus.png",
                "description": "Puts forth a shield known as the Curtain of Slumber, dealing AoE Cryo DMG.The Curtain of Slumber's DMG Absorption is based on Layla's Max HP and absorbs Cryo DMG with 250% effectiveness. When the shield is deployed, Layla will have Cryo applied to her briefly.Night Stars and Shooting StarsWhile the Curtain of Slumber is active, it will create 1 Night Star that will be attached to it every 1.5s. When a character protected by this shield uses an Elemental Skill, 2 Night Stars will be created. Night Stars can be created once every 0.3s in this way. A maximum of 4 Night Stars can be accumulated at any one time.Once the Curtain of Slumber has accumulated 4 Night Stars and there are opponents nearby, these Night Stars will transform into homing Shooting Stars that will be fired off in sequence, dealing Cryo DMG to any opponents hit.If the Curtain of Slumber's duration ends or it is destroyed, the Night Stars will disappear. If they are already being fired off as Shooting Stars, these Shooting Stars will last until this wave of shots ends.New Night Stars cannot be created until the previous wave of Shooting Stars has been fired completely."
            },
            {
                "name": "Dream of the Star-Stream Shaker",
                "type": "Elemental Burst",
                "icon": "assets/character/talents/Dream of the Star-Stream Shaker.png",
                "description": "Unleashes a Celestial Dreamsphere that constantly fires Starlight Slugs at opponents within its AoE, dealing Cryo DMG.When a Starlight Slug hits, it will generate 1 Night Star for nearby Curtains of Slumber. Each Curtain of Slumber can gain 1 Night Star this way every 0.5s."
            },
            {
                "name": "Like Nascent Light",
                "type": "1st Ascension Passive",
                "icon": "assets/character/talents/Like Nascent Light.png",
                "description": "While the Curtain of Slumber is active, the Deep Sleep effect will activate each time the Curtain gains 1 Night Star:The Shield Strength of a character under the effect of the Curtain of Slumber increases by 6%.This effect can have a maximum of 4 stacks and persists until the Curtain of Slumber disappears."
            },
            {
                "name": "Sweet Slumber Undisturbed",
                "type": "4th Ascension Passive",
                "icon": "assets/character/talents/Sweet Slumber Undisturbed.png",
                "description": "The DMG dealt by the Shooting Stars fired by Nights of Formal Focus is increased by 1.5% of Layla's Max HP."
            },
            {
                "name": "Shadowy Dream-Signs",
                "type": "Utility Passive",
                "icon": "assets/character/talents/Shadowy Dream-Signs.png",
                "description": "When Layla crafts Character Talent Materials, she has a 10% chance to receive double the product."
            }
        ],
